import React from "react";
import NavBar from "../component/NavBar";
import WelcomeSection from "../component/Welcome";
import GreetingSection from "../component/Greeting";
import ExploreSection from "../component/Explore";
// import EntertainmentSection from "../component/Entertainment";
import VideoSection from "../component/Video";
import LocationSection from "../component/Location";
import Footer from "../component/Footer";
import EntertainmentSection from "../component/home/Entertainment";

const HomePage = (props) =>{
    return(

      <div>
        <NavBar />
        <WelcomeSection />
        <GreetingSection />
        <ExploreSection />
        <EntertainmentSection/>
        <VideoSection />
        <LocationSection />
        <Footer />
      </div>
    )
}

export default HomePage
